  [],\n\t\"revision_timestamp\": \"2016-09-08T06:24:11.307076\",\n\t\"name\": \"logistics-center-support-system-lcss\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Logistics Center Support System (LCSS) is
  a non-NAS IT procurement to re-engineer and automate the FAA's logistics management
  processes. The program aims to modernize the FAA's supply chain and replace the
  20-year old Logistics Inventory System (LIS) through two segments The current system
  used to support this mission is known as the Logistics and Inventory System (LIS).
  \ LIS is an agency developed legacy mainframe application that lacks the capability
  and flexibility to accommodate the near term or future long-term supply support
  needs necessary to maintain the NAS.  LIS is built using Natural and COBOL languages
  and was deployed in 1990. Over the last two decades, over 39000 changes have been
  implemented in LIS. Its archaic architecture lacks the scalability to support the
  increased performance requirements projected by the NAS architecture.\",\n\t\"license_title\":
